import React from "react";

import { BrowserRouter, Link, Switch, Route } from "react-router-dom";
function News() {
  return (
    <div className="h-[100vh] bg-[#222]">
      <BrowserRouter>
        <nav className="w-full h-[50px] bg-red-300"></nav>

        <Switch>
          <Route exact path="/netflix">
            Netflix
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default News;
